import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

export default class RecommendationsRow extends React.Component {
	constructor(props) {
		super(props);
		this.props = {destCity: 'dashboard'};
	}

	render() {
		return (
			<div className="movieResults">
				<div className="title">
				<a className="nav-item nav-link" href={"/" + this.state.destCity}>{this.props.title}</a></div>
				<div className="id">{this.props.id}</div>
				<div className="rating">{this.props.rating}</div>
				<div className="votes">{this.props.vote_count}</div>
			</div>
		);
	}
}
